        stroke: color
      }; //CHANGE COLOR OF SELECTED NODE

      let selectedNodeIndex = state.elements.findIndex(data => data.id === state.node.id);
      state.elements[selectedNodeIndex] = { ...state.elements[selectedNodeIndex],
        data,
        style
      }; //OLD LOGIC - ADDS DUPLICATE NODES
