      //       style,
      //     };
      //   }
      //   return item;
      // });
      //CHANGE COLOR OF PARALLEL NODES AND UPDATE PARALLEL COMPS

      const ele2 = parallel_comp.map((item, index) => {
        const p_ele_index = state.elements.findIndex(x => x.id === item.value);
        state.elements[p_ele_index] = { ...state.elements[p_ele_index],
          style,
          data: { ...state.elements[p_ele_index].data,
            k: Number(action.payload.k),
            k_elh: Number(action.payload.k_elh),
            k_c: Number(action.payload.k_c),
            k_ds: Number(action.payload.k_ds),
            k_as: Number(action.payload.k_as),
            n: parallel_comp.length + 1,
            parallel_comp: [...parallel_comp.filter(pc => pc.value !== item.value), {
              value: state.node.id,
              label: data.label
            }]
          }
        };
      }); //CHANGE EDGE COLORS

      const ele3 = parallel_comp.map((item, index) => {
        const edgeId = state.elements.findIndex(x => x.target === item.value && x.source === state.selectedNodeParent);
        state.elements[edgeId] = { ...state.elements[edgeId],
          style: edgeStyle,
          type: "smoothstep",
          animated: false
        };
      }); //Changing color of edge to clicked node

      let clickedNodeEdgeIndex = state.elements.findIndex(x => x.target === state.node.id);

      if (clickedNodeEdgeIndex !== -1) {
