      let edgeStyle = {
        stroke: color
      };
      const ele1 = selectedNodes.map((item, index) => {
        const filtered_item = state.elements.filter(x => x.id === item.value)[0];
        const data = { ...filtered_item.data,
          k: 2,
          n: 4,
          swR: 0.8
        };
        return { ...filtered_item,
          data: data
        };
      }); //Update Edge

      const edge1 = selectedNodes.map((item, index) => {
        const filterEdge = state.elements.filter(x => x.target === item.value)[0];
        return { ...filterEdge,
          style: edgeStyle,
          animated: true
        };
      });
      state.elements = [...state.elements, ...ele1, ...edge1];
    },

    onRestoreHandler(state, action) {
      const elements = action.payload.elements;
      state.elements = elements;
